import React from 'react';
import ReactDOM from 'react-dom';
import './Avatar.css';
import img from './assest/img/image.jpg'

const Avatar = () => {
	return (<div className="avatar_style">
		<img src={img} alt="profile"/>
		<h1> Biswajit </h1>
		<p> Web Developer </p>
		</div>);
	}
export default Avatar;
